INSERT INTO `book_lesson` VALUES (1,51,10,'10',NULL,'yes','Clojure for the Brave and True is the go-to book for learning to program in Clojure. The book distills passion, and it\'s funny, very well written and covers in great depth everything you need to start doing some serious programming. I think I\'ve bought the book more than once!','this_week','0000-00-00 00:00:00','my_place','','myself','','0000-00-00 00:00:00',NULL,'01020304050','15 Rue de Dunkerque, Paris, France','2016-02-06 16:55:49','2016-01-31 12:08:32'),(2,51,10,'10',NULL,'yes','I am not especially brave, and I\'ve been known to not tell the truth. Nonetheless, this is the book I always recommend to people who are already programmers in another language and want a fun, lighthearted, yet solid introduction to Clojure\r\n','this_week','0000-00-00 00:00:00','my_place','','myself','','0000-00-00 00:00:00',NULL,'01020304050','45 Rue du PrÃ©sident Wilson, Dunkerque, France','2016-03-06 13:03:35','2016-01-31 15:52:52'),(3,51,10,'10',NULL,'no','I am not especially brave, and I\'ve been known to not tell the truth. Nonetheless, this is the book I always recommend to people who are already programmers in another language and want a fun, lighthearted, yet solid introduction to Clojure\r\n','this_week','0000-00-00 00:00:00','my_place','','myself','','0000-00-00 00:00:00',NULL,'01020304050','45 Rue du PrÃ©sident Wilson, Dunkerque, France','2016-03-06 13:03:41','2016-01-31 15:55:31'),(4,51,10,'10',NULL,'no','I am not especially brave, and I\'ve been known to not tell the truth. Nonetheless, this is the book I always recommend to people who are already programmers in another language and want a fun, lighthearted, yet solid introduction to Clojure\r\n','this_week','0000-00-00 00:00:00','my_place','','myself','','0000-00-00 00:00:00',NULL,'01020304050','45 Rue du PrÃ©sident Wilson, Dunkerque, France','2016-03-06 13:03:14','2016-01-31 16:18:31'),(5,51,10,'6',NULL,'yes','Hi there,\r\n\r\nI have read a lot about the Curry-Howard isomorphism, but its relevance is not yet clear to me. I know there are experts on this topic here in this board, so please enlighten me :-)\r\n\r\nTechnically, I understand the relation between simply-typed lambda calculus and constructive logic and how the isomorphism between proofs and programs works.\r\n','asap','0000-00-00 00:00:00','any','','myself','','0000-00-00 00:00:00',NULL,'0601020304','34 Rue de Dunkerque, Paris, France','2016-02-06 22:20:13','2016-02-06 21:41:18');
